import os, json, hmac, hashlib, time, sys
from datetime import datetime
from cryptography.fernet import Fernet

# ====== CONFIG: ganti ini dengan nilai ENV Vercel yang sama ======
# contoh: FERNET_KEY = b'2sBztYz2G0NBlfMfYhHiRrH9FwbmNhy6P3kE6QfMxa0='
FERNET_KEY = b"4U-3czII6QOEGciFLRltxqjrt8uWqnyguS9DEyyKu8o="   # bytes
HMAC_SECRET = "fb6ef2e0cdd4e38d92d1b115fdcf3c723f6c35d92ebd9fa8a7dfb0064201c167"  # hex or str
# ==================================================================

LICENSE_FILE = "license.enc"   # file yang dikirim user (isi: JSON string)
TRIAL_RECORD = ".trial"        # internal file to store encrypted trial info
TRIAL_DAYS = 7                 # durasi trial

fernet = Fernet(FERNET_KEY)

def _compute_hmac_hex(msg: bytes) -> str:
    # if HMAC_SECRET is hex string, convert first; else treat as raw str
    try:
        key = bytes.fromhex(HMAC_SECRET)
    except Exception:
        key = HMAC_SECRET.encode()
    return hmac.new(key, msg, hashlib.sha256).hexdigest()

def verify_license_file() -> (bool, str):
    """
    Return (ok: bool, message: str)
    Expects license.enc content exactly as response body from /api/generate-license:
      {"data":"<fernet-token>","hmac":"<hex>"}
    """
    if not os.path.exists(LICENSE_FILE):
        return False, "License file not found"

    try:
        raw = open(LICENSE_FILE, "r", encoding="utf-8").read().strip()
        # try parse as JSON object
        try:
            obj = json.loads(raw)
            token = obj.get("data")
            hmac_hex = obj.get("hmac")
            if not token or not hmac_hex:
                return False, "License file format invalid"
        except json.JSONDecodeError:
            # legacy: maybe file directly contains token, treat as token-only (no hmac)
            token = raw
            hmac_hex = None

        # verify HMAC if present
        if hmac_hex:
            expected = _compute_hmac_hex(token.encode())
            if not hmac.compare_digest(expected, hmac_hex):
                return False, "License HMAC mismatch (tampered)"

        # decrypt token
        try:
            decrypted = fernet.decrypt(token.encode())  # bytes
        except Exception as e:
            return False, f"Failed to decrypt license (invalid key or token): {e}"

        payload = json.loads(decrypted.decode())
        # payload expected keys: user, expire (ISO or YYYY-MM-DD), created, license_id (depends on generator)
        expire_raw = payload.get("expire")
        if not expire_raw:
            return False, "License payload missing expire date"

        # parse expire: accept ISO or 'YYYY-MM-DD'
        try:
            if "T" in expire_raw:
                expire_dt = datetime.fromisoformat(expire_raw)
            else:
                expire_dt = datetime.strptime(expire_raw, "%Y-%m-%d")
        except Exception:
            return False, "License expire date format invalid"

        if datetime.now() > expire_dt:
            return False, f"License expired on {expire_dt.date()}"

        user = payload.get("user", "(no user)")
        return True, f"License valid for {user} until {expire_dt.date()}"

    except Exception as e:
        return False, f"License verification error: {e}"

# ---------------- Trial handling (encrypted) ----------------
def _write_trial_encrypted(start_ts: int):
    obj = {"start": start_ts}
    raw = json.dumps(obj, separators=(",", ":"), sort_keys=True).encode()
    token = fernet.encrypt(raw)
    with open(TRIAL_RECORD, "wb") as f:
        f.write(token)

def _read_trial_encrypted():
    if not os.path.exists(TRIAL_RECORD):
        return None
    try:
        token = open(TRIAL_RECORD, "rb").read()
        raw = fernet.decrypt(token)
        obj = json.loads(raw.decode())
        return obj
    except Exception:
        return None

def trial_ok() -> (bool, str):
    existing = _read_trial_encrypted()
    if existing is None:
        # start trial now
        start = int(time.time())
        _write_trial_encrypted(start)
        return True, f"Trial started: {TRIAL_DAYS} days (0 used)"
    start_ts = int(existing.get("start", 0))
    elapsed = int(time.time()) - start_ts
    days_used = elapsed // 86400
    if days_used < TRIAL_DAYS:
        remain = TRIAL_DAYS - days_used
        return True, f"Trial active, {remain} day(s) remaining"
    else:
        return False, f"Trial expired ({TRIAL_DAYS} days used)"

# Optional helper to reset trial (dev)
def _clear_trial():
    if os.path.exists(TRIAL_RECORD):
        os.remove(TRIAL_RECORD)
        return True
    return False
