    ok, msg = verify_license_file()
    if ok:
        print("[LICENSE] " + msg)
    else:
        # license not valid or missing -> fallback to trial
        t_ok, t_msg = trial_ok()
        if t_ok:
            print("[TRIAL] " + t_msg + "  (license msg: " + msg + ")")
        else:
            # if trial expired too -> exit
            print("[LICENSE ERROR] " + msg + " | " + t_msg)
            print("Application will exit. Request a license from developer.")
            sys.exit(0)

    # proceed to open browser and run flask
    import webbrowser
    webbrowser.open("http://127.0.0.1:5000")
    app.run(host='127.0.0.1', port=5000, debug=False)
